import FullCalendar from "@fullcalendar/react";
import timeGridPlugin from "@fullcalendar/timegrid";
import { useEffect } from "react";
import { API } from "../../util/api/Api.js";
import "./home.css";

let api = new API();

const cronDetails = {
  currentDate: "Wed, 26 Dec 2012 12:38:53 UTC",
  endDate: "Wed, 26 Dec 2012 14:40:00 UTC",
  cron: "0 * 8-23 ?  * MON,TUE,WED,THU,FRI",
};

function Home(props) {
  const getTriggerTimes = () => {
    return new Promise((resolve) => {
      api
        .getTriggerTimes(cronDetails)
        .then((res) => {})
        .catch((err) => {
          console.log(err);
        });
    });
  };

  const handleDateClick = (arg) => {
    // bind with an arrow function
    alert(arg.dateStr);
  };

  return (
    <div>
      <div>
        <FullCalendar
          plugins={[timeGridPlugin]}
          initialView="timeGridDay"
          allDaySlot={false}
          eventMinHeight={20}
          customButtons={{
            reload: {
              text: "Reload",
              click: function () {
                alert("clicked the custom button!");
              },
            },
          }}
          headerToolbar={{
            left: "reload,prev,next",
            right: "today,timeGridDay,timeGridWeek",
          }}
          eventClick={function (arg) {
            alert(arg.event.title);
            alert(arg.event.start);
          }}
          slotDuration="00:05:00"
          events={[
            {
              title: "Event 1",
              start: "2022-04-23T14:40:00",
              end: "2022-04-23T14:40:01",
            },
            {
              title: "Event 2",
              start: "2022-04-23T09:00:00",
              end: "2022-04-23T09:00:01",
            }
          ]}
        />
      </div>
    </div>
  );
}

export default Home;
